import React from "react";

const SearchBar = ({ backToNormal, searchEvent, search }) => {
  return (
    <>
      <div className="main_note" onDoubleClick={backToNormal}>
        <input
          type="search"
          id="gsearch"
          placeholder="Search Notes"
          onChange={searchEvent}
          value={search}
          autoComplete="off"
        />
      </div>
    </>
  );
};

export default SearchBar;
